import { useState } from 'react';
import useForm from '../lib/useForm';

const CreateProduct = () => {
  const { inputs, handleChange } = useForm();
  console.log(inputs);
  return (
    <form>
      <label htmlFor='name'>
        Name
        <input
          type='text'
          id='name'
          name='name'
          value={inputs.name}
          onChange={(e) => handleChange(e)}
        />
      </label>
      <label htmlFor='price'>
        Price
        <input
          type='text'
          id='price'
          name='price'
          value={inputs.price}
          onChange={(e) => handleChange(e)}
        />
      </label>
    </form>
  );
};

export default CreateProduct;
